int main() {
    setlocale(LC_ALL, "Russian");
    char input[100]; // –ú–∞–∫—Å–∏–º–∞–ª—å–Ω–∞—è –¥–ª–∏–Ω–∞ –≤–≤–æ–¥–∞
    printf("–í–≤–µ–¥–∏—Ç–µ —Å—Ç—Ä–æ–∫—É: ");
    gets(input);

    int len = strlen(input);
    char selected_letters[100]; // –ú–∞–∫—Å–∏–º–∞–ª—å–Ω–∞—è –¥–ª–∏–Ω–∞ —Å—Ç—Ä–æ–∫–∏ —Å –≤—ã–±—Ä–∞–Ω–Ω—ã–º–∏ –±—É–∫–≤–∞–º–∏
    int selected_count = 0;
    int length = 0;

    for (int i = 0; i < len; i++) {
        char c = input[i];
        if ((c >= 'Q' && c <= 'Z') || (c >= 'q' && c <= 'z')) {
            // –ï—Å–ª–∏ –±—É–∫–≤–∞ –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –≤ –¥–∏–∞–ø–∞–∑–æ–Ω–µ –æ—Ç 'Q' –¥–æ 'Z' –∏–ª–∏ –æ—Ç 'q' –¥–æ 'z'
            // –ü—Ä–µ–æ–±—Ä–∞–∑—É–µ–º —Å—Ç—Ä–æ—á–Ω—ã–µ –±—É–∫–≤—ã –≤ –∑–∞–≥–ª–∞–≤–Ω—ã–µ
            selected_letters[selected_count++] = toupper(c);
            length++;
        }
    }

    // –°–æ—Ä—Ç–∏—Ä–æ–≤–∫–∞ –≤—ã–±—Ä–∞–Ω–Ω—ã—Ö –±—É–∫–≤ –≤ –∞–ª—Ñ–∞–≤–∏—Ç–Ω–æ–º –ø–æ—Ä—è–¥–∫–µ
    for (int i = 0; i < selected_count - 1; i++) {
        for (int j = i + 1; j < selected_count; j++) {
            if (selected_letters[i] > selected_letters[j]) {
                char temp = selected_letters[i];
                selected_letters[i] = selected_letters[j];
                selected_letters[j] = temp;
            }
        }
    }

    // –í—ã–≤–æ–¥ –æ—Ç—Å–æ—Ä—Ç–∏—Ä–æ–≤–∞–Ω–Ω—ã—Ö –±—É–∫–≤
    printf("–û—Ç—Å–æ—Ä—Ç–∏—Ä–æ–≤–∞–Ω–Ω—ã–µ –±—É–∫–≤—ã –æ—Ç Q(q) –¥–æ Z(z): ");

    for (int i = 0; i < length; i++) {
        printf("%c", selected_letters[i]);
    }

    return 0;
}

