    char letters[100]; // –î–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –±—É–∫–≤ –∏–∑ —Å—Ç—Ä–æ–∫–∏
    char output[200]; // –î–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞
    int i, j = 0, k = 0, l = 0;

    printf("–í–≤–µ–¥–∏—Ç–µ —Å—Ç—Ä–æ–∫—É: ");
    fgets(input, sizeof(input), stdin);
    input[strcspn(input, "\n")] = '\0'; 

    // –†–∞–∑–¥–µ–ª—è–µ–º —Å—Ç—Ä–æ–∫—É –Ω–∞ —Ü–∏—Ñ—Ä—ã –∏ –±—É–∫–≤—ã
    for (i = 0; input[i] != '\0'; i++) {
        if (isdigit(input[i])) {
            digits[j++] = input[i];
        }
        else if (isalpha(input[i])) {
            letters[k++] = input[i];
        }
    }
    digits[j] = '\0';
    letters[k] = '\0';

    // –ü–µ—Ä–µ–≤–æ—Ä–∞—á–∏–≤–∞–µ–º —Å—Ç—Ä–æ–∫—É —Å –±—É–∫–≤–∞–º–∏
    int lettersLength = strlen(letters);
