    // –§–æ—Ä–º–∏—Ä—É–µ–º —Ä–µ–∑—É–ª—å—Ç–∏—Ä—É—é—â—É—é —Å—Ç—Ä–æ–∫—É
    for (i = 0; i < j; i++) {
        output[i] = digits[i];
    }
    for (i = 0; i < lettersLength; i++) {
        output[j + i] = letters[i];
    }
    output[j + lettersLength] = '\0';

    printf("–†–µ–∑—É–ª—å—Ç–∞—Ç: %s\n", output);

    return 0;
}

