    function euplatesc_mac($data, $key)
    {
        $str = NULL;
        foreach ($data as $d) {
            if ($d === NULL || strlen($d) == 0) {
                $str .= '-';
            } else {
                $str .= strlen($d) . $d;
            }
        }
        return hash_hmac('MD5', $str, pack('H*', $key));
    }

