using namespace std;

// Struktur untuk data buah
struct Buah {
    string nama;
    int harga;
    Buah* next;
    Buah* prev;

    Buah(string _nama, int _harga) : nama(_nama), harga(_harga), next(nullptr), prev(nullptr) {}
};

Buah* head = nullptr;
Buah* tail = nullptr;

// Fungsi untuk memasukkan buah dari depan
void inputBuahDepan(string nama, int harga) {
    Buah* buahBaru = new Buah(nama, harga);
    if (head == nullptr) {
        head = buahBaru;
        tail = buahBaru;
    } else {
        buahBaru->next = head;
        head->prev = buahBaru;
        head = buahBaru;
    }
}

// Fungsi untuk memasukkan buah dari belakang
void inputBuahBelakang(string nama, int harga) {
    Buah* buahBaru = new Buah(nama, harga);
    if (tail == nullptr) {
        head = buahBaru;
        tail = buahBaru;
    } else {
        buahBaru->prev = tail;
        tail->next = buahBaru;
        tail = buahBaru;
    }
}

// Fungsi untuk mencetak buah dari depan
void cetakBuahDepan() {
    if (head == nullptr) {
        cout <<""<<endl;
        cout << "List buah masih kosong" << endl;
        return;
    }

    Buah* current = head;
    cout <<"======================================"<<endl;
    cout <<"Daftar Buah"<<endl;
    cout <<"======================================"<<endl;
    while (current != nullptr) {
        cout << "Nama: " << current->nama << ", Harga: " << current->harga << endl;
        current = current->next;
    }
}

// Fungsi untuk mencetak buah dari belakang
void cetakBuahBelakang() {
    if (tail == nullptr) {
        cout <<""<<endl;
        cout << "List buah masih kosong" << endl;
        return;
    }

    Buah* current = tail;
    cout <<"======================================"<<endl;
    cout <<"Daftar Buah"<<endl;
    cout <<"======================================"<<endl;
    while (current != nullptr) {
        cout << "Nama: " << current->nama << ", Harga: " << current->harga << endl;
        current = current->prev;
    }
}

// Fungsi untuk menghapus buah dari depan
void hapusBuahDepan() {
    if (head != nullptr) {
        Buah* buahHapus = head;
        head = head->next;
        if (head != nullptr) {
            head->prev = nullptr;
        } else {
            tail = nullptr;
        }
        delete buahHapus;
    } else {
        cout << "List buah kosong" << endl;
    }
}

// Fungsi untuk menghapus buah dari belakang
void hapusBuahBelakang() {
    if (tail != nullptr) {
        Buah* buahHapus = tail;
        tail = tail->prev;
        if (tail != nullptr) {
            tail->next = nullptr;
        } else {
            head = nullptr;
        }
        delete buahHapus;
    } else {
        cout << "List buah kosong" << endl;
    }
}

